ISLAMABAD, Sep 10 (APP): Members of the National Assembly Mohammad Siddique Khan Baloch and Abdul Rehman Kanjo met Prime Minister Mohammad Shehbaz Sharif on Tuesday to address issues concerning their constituencies.
During the meeting, the overall political situation of the country was also discussed, a Prime Minister Office press release stated.
